struct MarchingCubes
{
protected:
	static double phi[9];
	static double xmin,xmax;
	static double ymin,ymax;
	static double zmin,zmax;
	
	inline static double INTP( double   x1, double  x2,
			                   double phi1, double phi2)
	{ return (x1*phi2-x2*phi1)/(phi2-phi1);}
	
	static void get_edge_point( int e, POINT3& P)
	{
		switch(e)
		{
		case  1: P.x=INTP(xmin,xmax,phi[1],phi[2]); P.y=     ymin                    ; P.z=          zmax               ;break;
		case  2: P.x=          xmax               ; P.y=INTP(ymin,ymax,phi[2],phi[3]); P.z=          zmax               ;break;
		case  3: P.x=INTP(xmin,xmax,phi[4],phi[3]); P.y=          ymax               ; P.z=          zmax               ;break;
		case  4: P.x=     xmin                    ; P.y=INTP(ymin,ymax,phi[1],phi[4]); P.z=          zmax               ;break;
		case  5: P.x=INTP(xmin,xmax,phi[5],phi[6]); P.y=     ymin                    ; P.z=     zmin                    ;break;
		case  6: P.x=          xmax               ; P.y=INTP(ymin,ymax,phi[6],phi[7]); P.z=     zmin                    ;break;
		case  7: P.x=INTP(xmin,xmax,phi[8],phi[7]); P.y=          ymax               ; P.z=     zmin                    ;break;
		case  8: P.x=     xmin                    ; P.y=INTP(ymin,ymax,phi[5],phi[8]); P.z=     zmin                    ;break;
		case  9: P.x=     xmin                    ; P.y=     ymin                    ; P.z=INTP(zmin,zmax,phi[5],phi[1]);break;
		case 10: P.x=          xmax               ; P.y=     ymin                    ; P.z=INTP(zmin,zmax,phi[6],phi[2]);break;
		case 11: P.x=          xmax               ; P.y=          ymax               ; P.z=INTP(zmin,zmax,phi[7],phi[3]);break;
		case 12: P.x=     xmin                    ; P.y=          ymax               ; P.z=INTP(zmin,zmax,phi[8],phi[4]);break;
		case 13: P.x=.5*(xmin+xmax)               ; P.y=.5*(ymin+ymax)               ; P.z=.5*(zmin+zmax)               ;break;
		}
	}
	
public:
	static void isosurface( double phi_[2][2][2],
			                double xmin_, double xmax_,
			                double ymin_, double ymax_,
			                double zmin_, double zmax_, STACK<POINT3>& pts)
	{
		//
		static const double eps=1E-8;
		phi[1] = phi_[0][0][1]; if(fabs(phi[1])<eps) phi[1]=(phi[1]>0)?eps:-eps;
		phi[2] = phi_[1][0][1]; if(fabs(phi[2])<eps) phi[2]=(phi[2]>0)?eps:-eps;
		phi[3] = phi_[1][1][1]; if(fabs(phi[3])<eps) phi[3]=(phi[3]>0)?eps:-eps;
		phi[4] = phi_[0][1][1]; if(fabs(phi[4])<eps) phi[4]=(phi[4]>0)?eps:-eps;
		phi[5] = phi_[0][0][0]; if(fabs(phi[5])<eps) phi[5]=(phi[5]>0)?eps:-eps;
		phi[6] = phi_[1][0][0]; if(fabs(phi[6])<eps) phi[6]=(phi[6]>0)?eps:-eps;
		phi[7] = phi_[1][1][0]; if(fabs(phi[7])<eps) phi[7]=(phi[7]>0)?eps:-eps;
		phi[8] = phi_[0][1][0]; if(fabs(phi[8])<eps) phi[8]=(phi[8]>0)?eps:-eps;
		
		//
		xmin=xmin_; xmax=xmax_;
		ymin=ymin_; ymax=ymax_;
		zmin=zmin_; zmax=zmax_;
		
		//
		int case_number = 0;
		if(phi[1]>0) case_number+=1;
		if(phi[2]>0) case_number+=2;
		if(phi[3]>0) case_number+=4;
		if(phi[4]>0) case_number+=8;
		if(phi[5]>0) case_number+=16;
		if(phi[6]>0) case_number+=32;
		if(phi[7]>0) case_number+=64;
		if(phi[8]>0) case_number+=128;
		
		//
		int default_case = match_case_with_defaultcase[case_number][0];
		int          sub = match_case_with_defaultcase[case_number][1];
		
		POINT3 P;
		int* table;
		
		//
		switch(default_case)
		{
			if(default_case==13)
			{
				printf("warning in marching cubes : 13case is met\n");
			}
		
			case  1: table = case1 [sub]; for(int i=0;i< 3;i++){get_edge_point(table[i],P);pts.push(P);} break;
			case  2: table = case2 [sub]; for(int i=0;i< 6;i++){get_edge_point(table[i],P);pts.push(P);} break;
			case  4: table = case4 [sub]; for(int i=0;i< 6;i++){get_edge_point(table[i],P);pts.push(P);} break;
			case  5: table = case5 [sub]; for(int i=0;i< 9;i++){get_edge_point(table[i],P);pts.push(P);} break;
			case  8: table = case8 [sub]; for(int i=0;i< 6;i++){get_edge_point(table[i],P);pts.push(P);} break;
			case  9: table = case9 [sub]; for(int i=0;i<12;i++){get_edge_point(table[i],P);pts.push(P);} break;
			case 11: table = case11[sub]; for(int i=0;i<12;i++){get_edge_point(table[i],P);pts.push(P);} break;
			case 13: table = case13[sub]; for(int i=0;i<12;i++){get_edge_point(table[i],P);pts.push(P);} break;
			case 14: table = case14[sub]; for(int i=0;i<12;i++){get_edge_point(table[i],P);pts.push(P);} break;
			
			case 3:
			{
				int* test = case3_test[sub];
				
				if(phi[test[0]]*phi[test[1]]<phi[test[2]]*phi[test[3]]){ table=case3A[sub]; for(int i=0;i< 6;i++){get_edge_point(table[i],P);pts.push(P);}}
				else												   { table=case3B[sub]; for(int i=0;i<12;i++){get_edge_point(table[i],P);pts.push(P);}}
				break;
			}
			case 6:
			{
				int* test = case6_test[sub];
				
				if(phi[test[0]]*phi[test[1]]<phi[test[2]]*phi[test[3]]){ table=case6A[sub]; for(int i=0;i< 9;i++){get_edge_point(table[i],P);pts.push(P);}}
				else												   { table=case6B[sub]; for(int i=0;i<15;i++){get_edge_point(table[i],P);pts.push(P);}}
				break;
			}
			case 7:
			{
				int* test = case7_test[sub];
				
				bool b1 = phi[test[0]]*phi[test[1]]<phi[test[ 2]]*phi[test[ 3]];
				bool b2 = phi[test[4]]*phi[test[5]]<phi[test[ 6]]*phi[test[ 7]];
				bool b3 = phi[test[8]]*phi[test[9]]<phi[test[10]]*phi[test[11]];
				
				if( b1 && b2 && b3){ table=case7A[sub]; for(int i=0;i< 9;i++){get_edge_point(table[i],P);pts.push(P);}}
				if( b1 && b2 &&!b3){ table=case7B[sub]; for(int i=0;i<15;i++){get_edge_point(table[i],P);pts.push(P);}}
				if( b1 &&!b2 && b3){ table=case7C[sub]; for(int i=0;i<15;i++){get_edge_point(table[i],P);pts.push(P);}}
				if( b1 &&!b2 &&!b3){ table=case7D[sub]; for(int i=0;i<27;i++){get_edge_point(table[i],P);pts.push(P);}}
				if(!b1 && b2 && b3){ table=case7E[sub]; for(int i=0;i<15;i++){get_edge_point(table[i],P);pts.push(P);}}
				if(!b1 && b2 &&!b3){ table=case7F[sub]; for(int i=0;i<27;i++){get_edge_point(table[i],P);pts.push(P);}}
				if(!b1 &&!b2 && b3){ table=case7G[sub]; for(int i=0;i<27;i++){get_edge_point(table[i],P);pts.push(P);}}
				if(!b1 &&!b2 &&!b3){ table=case7H[sub]; for(int i=0;i<15;i++){get_edge_point(table[i],P);pts.push(P);}}
				
				break;
			}
			case 10:
			{
				int* test = case10_test[sub];
				
				bool b1 = phi[test[0]]*phi[test[1]]<phi[test[ 2]]*phi[test[ 3]];
				bool b2 = phi[test[4]]*phi[test[5]]<phi[test[ 6]]*phi[test[ 7]];
				
				if( b1 && b2){ table=case10A[sub]; for(int i=0;i<12;i++){get_edge_point(table[i],P);pts.push(P);}}
				if( b1 &&!b2){ table=case10B[sub]; for(int i=0;i<24;i++){get_edge_point(table[i],P);pts.push(P);}}
				if(!b1 && b2){ table=case10C[sub]; for(int i=0;i<24;i++){get_edge_point(table[i],P);pts.push(P);}}
				if(!b1 &&!b2){ table=case10D[sub]; for(int i=0;i<12;i++){get_edge_point(table[i],P);pts.push(P);}}
				
				break;
			}
			case 12:
			{
				int* test = case12_test[sub];
				
				bool b1 = phi[test[0]]*phi[test[1]]<phi[test[ 2]]*phi[test[ 3]];
				bool b2 = phi[test[4]]*phi[test[5]]<phi[test[ 6]]*phi[test[ 7]];
				
				if( b1 && b2){ table=case12A[sub]; for(int i=0;i<12;i++){get_edge_point(table[i],P);pts.push(P);}}
				if( b1 &&!b2){ table=case12B[sub]; for(int i=0;i<18;i++){get_edge_point(table[i],P);pts.push(P);}}
				if(!b1 && b2){ table=case12C[sub]; for(int i=0;i<24;i++){get_edge_point(table[i],P);pts.push(P);}}
				if(!b1 &&!b2){ table=case12D[sub]; for(int i=0;i<12;i++){get_edge_point(table[i],P);pts.push(P);}}
				
				break;
			}
		};
	}
};



